Sex Toy Stories
One in three British women owns a vibrator, but many are designed by men. Now, a group of eight ordinary women are going to work with Ann Summers to create a sex toy made by women for women. They're a diverse group, including 69-year-old grandma Margaret, a twentysomethings virgin and a middle aged divorcee who has never achieved an orgasm. One thing unites them that they think there's a gap in the market and they are determined to fill it. Filmed over a course of a year, this is the story of how a group of regular ladies turned their fantasies into reality and reveals what women really want in the bedroom. Designing a sex toy is a labour of love. The women road test toys that are currently on the market and one brave mum even does the weekly shop at the same time. They turn to the contents of their kitchen cupboards to create models of their dream sex toy. This determined group of women know what they want, but can Ann Summers get it onto the shelves in time for Valentine's Day?

